import getConfig from 'next/config'
const {publicRuntimeConfig}=getConfig()
console.log(publicRuntimeConfig.DOMAIN_PRODUCTION)
export const API=publicRuntimeConfig.PRODUCTION ? 'http://seoblog.com':'http://localhost:5000'
export const APP_NAME=publicRuntimeConfig.APP_NAME;
export const DOMAIN=publicRuntimeConfig.PRODUCTION?publicRuntimeConfig.DOMAIN_DEVELOPMENT:'https://seoblog.com';
export const FB_APP_ID = publicRuntimeConfig.FB_APP_ID;
